import React from "react";
import axios from "axios";
import { fetchCity } from "./redux/actions/actions";

function App() {
  const makeApiCall = async () => {
    const data = await axios.get(
      `https://api.openweathermap.org/data/2.5/weather?q=francia&appid=28bc287a42d8c0411e4c0100378bc6ad`
    );
    console.log(data);
  };

  return (
    <div className="App">
      <input onChange={(e) => fetchCity(e.target.value)}>Make API CALL</input>
    </div>
  );
}

export default App;
